import React from 'react';
import {NavLink, Link, withRouter } from 'react-router-dom';
/* pass the props to the navbar the props have the history object with the push 
    method attached to it. use the push to "push" (redirect) to a different page */
const Navbar = (props)=>{
    setTimeout(()=>{
        props.history.push('/')
    }, 5000);
    return(
        <nav className="nav-wrapper red darken-3">
            <div className="container">
                <a href='' className="brand-logo">Spa Application</a>
                <ul className='right'>
                    <li><NavLink to="/">Home</NavLink></li>
                    <li><NavLink to="/about">About</NavLink></li>
                    <li><NavLink to="/contact">Contact</NavLink></li>
                </ul>
            </div>
        </nav>
    )
} 

/* withRouter is a Higher Order Component (HOC) that will wrap the navbar with router 
information like props. This HOC comes with the react-router-dom */
export default withRouter(Navbar)
